import React from "react";
import image from '../assets/imgs/IT.jpeg'

export default function About({ headerHeight }) {
    const aboutHeight = `calc(100vh - ${headerHeight}px)`;

    return (
        <img src={image} alt="IT" className="{`h-[${aboutHeight}]`}" />
    )
}
